import Layout from '../../components/Layout'
import { useRouter } from 'next/router';

const NutrientDetailsPage = () =>{
    const router = useRouter();
    const fdcId = router.query.fdcId;

    return(
        <Layout>
        <h3>{fdcId}</h3>
        </Layout>
    )
} 

export default NutrientDetailsPage;
